    uint256 supply = totalSupply();
    require(!paused);
    require(supply + _mintAmount <= maxSupply);
    uint256 totalCost = nftLine * _mintAmount;
    //uint256 taxes = ((10 * totalCost) / 100);
        
    //totalForTaxes += taxes;
    totalForSell += totalCost;

    for (uint256 i = 1; i <= _mintAmount; i++) {
    if(balanceOf(_to) > 0){
      (uint cAmount, uint cDividend) = getTodayProfit(_to);
      if(cAmount > 0){
      claimNum[_to] = cDividend; //countDividend;
      BUSD.transfer(_to, cAmount);  
       totalBusdClaimed += cAmount;
      }
    }
        
    nftPriceBought[_to] += totalCost;
    _safeMint(_to, supply + i);
    lastClaim[_to] = block.timestamp + (claimSeconds);
    nftBUSDBonus[_to] = 0;
    nftBUSDClaimed[_to] = 0;
    if(countDividend==0){
    claimNum[_to] = countDividend;
    }
    else{
    claimNum[_to] = countDividend;    
    }
    nftOwner[supply + i] = _to;
    if(supply ==199){
        nftLine = 275;
    }
    else if(supply ==399){
        nftLine = 350;
    }
    else if(supply ==599){
        nftLine = 425;
    }
    else if(supply ==799){
        nftLine = 500;
    }
    }

  }
    
    function setRewardContract( address _BUSD) public onlyOwner{
        BUSD = IBEP20(_BUSD);
    }

    function setTeamWallet(address _teamWallet) public onlyOwner{
        teamWallet = _teamWallet;
    }

    function depositTradingBonus(uint256 amt) public onlyOwner{
        BUSD.transferFrom(msg.sender, address(this), amt);
        tradingBonus += amt;
    }


  function lastDistributionInfo() public view returns(uint, uint, uint, uint, uint, uint, uint, uint, uint){
      return (lastDistributedTime, lastTokenDistributed, totalNFTSell, totalForSell, totalForTaxes, totalBusdClaimed, tradingBonus, countDividend, dividendTotalUsers[countDividend]);
  }

  function getRewarsBUSD(address _addr) public view returns(uint, uint, uint, uint){
        return(nftBUSDClaimed[_addr], nftBUSDBonus[_addr], nftPriceBought[_addr], lastClaim[_addr]);
  }


  function getCurrentTime() public view returns (uint256) {
        return block.timestamp;
  }

